import useForm from '../lib/useForm';

export default function CreateProduct() {
  const [name, setName] = useState('Lisa');
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          placeholder="Product Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
      <label htmlFor="name">
        Price
        <input
          type="number"
          id="price"
          name="price"
          placeholder="Product Price"
          value={price}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
    </form>
  );
}
